import './App.css';
import Book from './Book';
import books from './data'

function App() {
  return (
    <main>
      <section className = "heading">
        <h2>Amazon Best Seller</h2>
        <div className = "underline"></div>
      </section>
      <section>
        <div className="container">
            {
              books.map((book) =>{
                <Book book={book}/>
              })
            }
        </div>
      </section>
    </main>
  );
}

export default App;
